		function L3onMouseMove(e) {
			muisx2 = sceneScherm.globalToLocal(stage.mouseX, stage.mouseY).x; muisy2 = sceneScherm.globalToLocal(stage.mouseX, stage.mouseY).y;
			if (Math.abs(muisy2 - muisy1) < Math.abs(muisx2 - muisx1)) {
				if ((muisx2 - muisx1) > swipeafstand) {swipeArray.push(1);removeEventListener("mousemove",L3onMouseMove);}
				else if ((muisx2 - muisx1) < -swipeafstand) {swipeArray.push(2);removeEventListener("mousemove",L3onMouseMove);}
			} else {
				if ((muisy2 - muisy1) > swipeafstand) {swipeArray.push(3);removeEventListener("mousemove",L3onMouseMove);}
				else if ((muisy2 - muisy1) < -swipeafstand) { swipeArray.push(4);removeEventListener("mousemove",L3onMouseMove);}
			}
		}
		
		
